import Page from 'components/Page';
import React from 'react';
import FadeIn from 'components/FadeIn';

import {
  Row,
} from 'reactstrap';

const DataPage = () => {
  return (
    <Page title="" >
        <Row >

      <FadeIn>
      <p className="authorsTitle">RECURSOS</p>
      </FadeIn> 

    </Row>
    </Page>
  );
};

export default DataPage;
